import React from 'react';
import { NavLink  } from 'react-router-dom';

const Menu = () => {
  return (
    <>
       <NavLink activeClassName='active-class' to='/'>About</NavLink>
       <NavLink activeClassName='active-class' to='/ContactUs'>ContactUs</NavLink>
      <a href="/">About</a>
      <a href="/contactUs">ContactUs</a>
    </>
  );
};

export default Menu;
